import React from 'react';
import './GameSummary.css';

const GameSummary = ({ gameState, onNewGame, onGoToHome }) => {
  const getWinner = () => {
    const { nsScore, ewScore } = gameState.scores;
    
    if (nsScore > ewScore) {
      return { team: 'North-South', score: nsScore };
    } else if (ewScore > nsScore) {
      return { team: 'East-West', score: ewScore };
    } else {
      return { team: 'Tie', score: nsScore };
    }
  };
  
  const formatContract = (contract) => {
    if (!contract) return '';
    
    // Extract declarer and convert to full name
    const match = contract.match(/([NESW])/);
    if (!match) return contract;
    
    const declarer = match[0];
    let declarerName = '';
    
    switch (declarer) {
      case 'N': declarerName = 'North'; break;
      case 'E': declarerName = 'East'; break;
      case 'S': declarerName = 'South'; break;
      case 'W': declarerName = 'West'; break;
      default: declarerName = declarer;
    }
    
    return contract.replace(declarer, declarerName);
  };
  
  const formatResult = (result) => {
    if (result === null || result === undefined) return '';
    
    if (result > 0) {
      return `+${result}`;
    } else if (result < 0) {
      return `${result}`;
    } else {
      return '=';
    }
  };
  
  const winner = getWinner();
  
  return (
    <div className="game-summary-container">
      <header className="gs-header">
        <h2>Game #{gameState.gameNumber} Summary</h2>
      </header>
      
      <div className="summary-content">
        <div className="final-scores">
          <h3>Final Scores</h3>
          <div className="score-card">
            <div className="team-score">
              <span className="team">North-South</span>
              <span className="score">{gameState.scores.nsScore}</span>
            </div>
            <div className="team-score">
              <span className="team">East-West</span>
              <span className="score">{gameState.scores.ewScore}</span>
            </div>
          </div>
          
          <div className="winner-display">
            <h3>Winner</h3>
            <div className="winner">
              {winner.team} with {winner.score} points
            </div>
          </div>
        </div>
        
        <div className="deals-summary">
          <h3>Deals Summary</h3>
          
          <div className="deals-table-container">
            <table className="deals-table">
              <thead>
                <tr>
                  <th>Deal</th>
                  <th>Contract</th>
                  <th>Result</th>
                  <th>NS</th>
                  <th>EW</th>
                </tr>
              </thead>
              <tbody>
                {gameState.deals.map((deal, index) => (
                  <tr key={index}>
                    <td>{deal.dealNumber}</td>
                    <td>{formatContract(deal.contract)}</td>
                    <td>{formatResult(deal.result)}</td>
                    <td>{deal.nsPoints}</td>
                    <td>{deal.ewPoints}</td>
                  </tr>
                ))}
              </tbody>
              <tfoot>
                <tr>
                  <td colSpan="3">Total</td>
                  <td>{gameState.scores.nsScore}</td>
                  <td>{gameState.scores.ewScore}</td>
                </tr>
              </tfoot>
            </table>
          </div>
        </div>
      </div>
      
      <div className="gs-actions">
        <button 
          className="bridge-button home-btn"
          onClick={onGoToHome}
        >
          Go to Home
        </button>
        
        <button 
          className="bridge-button new-game-btn"
          onClick={onNewGame}
        >
          New Game
        </button>
      </div>
    </div>
  );
};

export default GameSummary;
